export default class Header extends Component {

	constructor(props) {
		super(props);
	}

	render(){
		return (
			<header>
			  HEADER
        <hr />
				<br /><br />

				{this.props.children}

				<br /><br />
				<hr />
				FOOTER
			</header>
		)
	}
}
